description:
If you live in South Carolina and you are interested in joining a karate program, martial arts studio, or self defense classes, check out the information in the included documents. The PDF documents contain the most up to date information from Johnston Karate's classes page. Feel free to check out the page if you also want to find out about schools run by other instructors. Also, please feel free to visit the feedback section on the page if you want to ask any questions you may have about martial arts, health, fitness, training, and related areas, such as finding a good school.
